import React from 'react'

const MovieDetails = (props) => {
  const arrayofKey = Object.keys(props.itemDetails).map((r) => (
    <div
      key={r.id}>
      <img key={r.id} src={`https://image.tmdb.org/t/p/w185/${r.poster_path}`} alt={r.title} className='search-results-poster' />
      <a href='#t' className='search-results-name'>{props.itemDetails.name}</a>
    </div>
  ))
  return <div className='search-results'>{arrayofKey}</div>
}

export default MovieDetails
